var MarkdownIt,R,React,classes,createManualClass,fs,markdowns,renderMarkdown;React=require("react"),R=require("ramda"),MarkdownIt=require("markdown-it"),markdowns={General:"## Reactive Visualizer\nWelcome to using Reactive Visualizer.\n\nReactive Visualizer was created as a tool to aid in learning reactive programming using the Observable pattern.\n\n### Parts\n\nThe tool consists of four distinct parts:\n  1. this manual,\n  2. Observable editor,\n  3. inspector,\n  4. virtual time control,\n  5. persistence.\n",ObservableEditor:"### Purpose\nThe Observable editor provides a JavaScript editor for creating an Observable.\nThe building blocks for creating an Observable are factories and operators.\n\n### Factory\nAn Observable if created by specifying a factory, which produces the initial values.  \nA list of factories is provided in the drop-down next to `Rx.Observable.`.\n\nThe simplest Observable consists of a single factory:\n```js\n  Rx.Observable.just(5)\n```\n\n### Operators\nAn Observable can be transformed by applying an operator to it.\nAn Observable of 5 values every 500ms is created with:\n```js\n  Rx.Observable.interval(500)\n    .take(5)\n```\n\nA list of operators is provided in the drop-down which opens when hovering over the `+` symbol.  \nThe `+` symbol is located next to existing factories and operators.  \n\nAn operator can be removed by clicking on the `-` symbol.\n\n### Arguments\n\nThe arguments for any building block can be provided by as a JavaScript expression.  \nThere is always a default expression provided.  \nWhen making changes, the return type of the expression must remain same.\n\n#### Nested Observables\n\nSome building blocks can have arguments which themselves are Observables.  \nIn that case a nested Observable editor is created.  \n",Inspector:"### Purpose\nThe inspector shows values at a specified time for every Observable building block in the Observable editor.\n\n### Time\nAbove the Observable editor is row containing integers which denote the virtual time in milliseconds.  \nSometimes the integers might seem to be off by one, this is due to the asynchronous nature of the Observable.  \n\n### Values\nThe values leaving the Observable building blocks appear next to them.  \nFaintly colored visual clues help to identify which building block the values come from.  \nNote that only values **leaving** a building block are displayed.  \n\n#### Completion\nWhen some part of the Observable *completes* a green `C` is displayed in the inspector.\n\n#### Error\nWhen an error occurs in a part of the Observable the error message text is displayed in the inspector in red.\n\n#### Multiple values\nWhen multiple values come from a building block at the exact same time, then they are displayed next to each other.  \nOne unit of time is surrounded by a little border.  \n\n#### Previous values\nAs new values appear, older ones are shifted to the left.  \nThe most recent value is always the rightmost.  \n\n### Changes to the Observable\nWhenever the Observable is changed in the editor, it is analyzed and the values are updated in the inspector immediately.\n",VirtualTimeController:"### Purpose\nThe virtual time controller allows setting the internal clock of the Observable.\n\n### Controlling the clock\n\nThere are two ways to control the internal clock of the Observable.\n\n#### ***Play***\nThe *Play* button simulates the observable in pseudo-real-time.\n\n#### Slider\nThe slider allows setting the internal clock of the Observable simulation to a specific time.\n",Persistence:"### Purpose\n\nPersitence controls allow saving and loading example Observables using the *Load* and *Save* buttons.\n\n#### Loading\n\nClicking on the *Load* button opens a modal with the following panels.\n\n##### Bundled examples\n\nBundled examples are examples which are bundled with the Reactive Visualizer and cannot be changed.  \n\n##### User examples\n\nUser examples contain examples saved by the user.  \n\n##### Loading an example\n\nEvery example is described by its name, which appears on the left side,  \nand a short description which appears on the right.  \n\nTo load any example, click on it's name.  \n\nTo delete an example, click on the small red `x` button on the right side of the example.\n\n#### Saving an example\n\nThe *Save* button stores the current Observable in User examples.  \nWhen clicked, two mandatory inputs are presented:\n1. *Name*,\n2. *Description*.\n\nThese values will appear correspondingly in User examples.\n"},renderMarkdown=function(e){return MarkdownIt("default",{html:!0}).render(e)},createManualClass=function(e){return React.createClass({render:function(){return React.createElement("div",{className:"manualText",dangerouslySetInnerHTML:{__html:e}})}})},classes=R.mapObj(R.compose(createManualClass,renderMarkdown))(markdowns),module.exports=classes;
